sys_variable_value.value:
(function execute(inputs, outputs) {
    var claim = new GlideRecord("x_snc_w_claims_claim");

    outputs.work_notes = "";
    if (claim.get(inputs.claim_id))
        outputs.work_notes = claim.work_notes.getJournalEntry(-1);

})(inputs, outputs);

